let RESOURCETYPE = Object.freeze({
    Gold: 1,
    Oil: 2,
    Iron: 3,
    Limestone: 4,
    Coal: 5,

    GoldString: "Precious Metal",
    OilString: "Oil",
    IronString: "Iron",
    LimestoneString: "Limestone",
    CoalString: "Coal",

    getDisplayStringForType: function (type) {
        switch (type) {
            case RESOURCETYPE.Gold: return RESOURCETYPE.GoldString;
            case RESOURCETYPE.Oil: return RESOURCETYPE.OilString;
            case RESOURCETYPE.Iron: return RESOURCETYPE.IronString;
            case RESOURCETYPE.Limestone: return RESOURCETYPE.LimestoneString;
            case RESOURCETYPE.Coal: return RESOURCETYPE.CoalString;
        }
    }
});

let RESOURCEQUALITY = Object.freeze({
    HighFrequency: 1,
    None: 0,
    UnknownFrequency: -1,

    HighFrequencyString: "HF",
    NoneFrequencyString: "--",
    UnknownFrequencyString: "UF",

    getResourceQualityString: function (frequency) {
        switch (frequency) {
            case RESOURCEQUALITY.HighFrequency: return RESOURCEQUALITY.HighFrequencyString;
            case RESOURCEQUALITY.None: return RESOURCEQUALITY.NoneFrequencyString;
            case RESOURCEQUALITY.UnknownFrequency: return RESOURCEQUALITY.UnknownFrequencyString;
        }
    }
});

let config = Object.freeze({
    //when set to true you need to reload the page before running script again
    NeedReloadForFreshData: true,

    //when set to true, a downloadable csv file will be generated for further analysis
    GenerateCSVReport: false,

    //when set to false Tier1 properties are not processed
    ProcessT1: true,

    //when set to false Tier2 properties are not processed
    ProcessT2: true,

    //only slot properties between min and max tile count (inclusive) | min: 25 and max: 9999 means processing all properties having at least 25 and maximum 9999 tiles
    TileCountMin_Tier1: 9,
    TileCountMax_Tier1: 9999,

    TileCountMin_Tier2: 9,
    TileCountMax_Tier2: 9999,

    //when set to true -> properties with higher class gets processed first (ordered by tile count descending)
    OrderByClassFirst: false,

    //if contains either only -> only that gets slotted
    ResourceQualitiesToSlot: [RESOURCEQUALITY.HighFrequency, RESOURCEQUALITY.UnknownFrequency],

    //if empty -> slot all | if contains values -> slot in that order
    ResourceTypesToSlot: [RESOURCETYPE.Coal, RESOURCETYPE.Iron, RESOURCETYPE.Gold, RESOURCETYPE.Oil, RESOURCETYPE.Limestone],

    //when set to false and interference is detected (Anthracite-Black-Yellow), ResourceTypesToSlot decides the order where we keep the priming/booster jewels
    //e.g. if both Coal, Oil and Gold is present on a land only Coal priming jewel will be kept 
    //e.g. if Gold and Oil present only Gold will be kept
    IgnoreInterference: false,

    //when interference detected and one resource is HF while the other is UF we keep HF (and not resource order) if "true"
    PreferHFOverSlotOrderForInterference: true,

    //when set to true: during assigning booster jewels only use the same color once
    UseSameBoosterOnlyOnce: true,

    //when set to true: if during the first pass (priming+boosters) we have properties left with free slots -> slot them first with orange, then with purple (only one each)
    SlotPurpleAndOrangeOnPass1: true,

    //for debug purposes -> if true, shows calculated Pass1 slottings, interferences, missing and potential booster jewels
    ShowPass1Slotting: false,

    //for debug purposes -> if true, shows current slotting (and the calculated ones too)
    ShowCurrentVsCalculatedSlotting: true,

    //when set to true skips already properties with already slotted jewels
    SkipPropertiesWithAlreadySlottedJewels: false,

    //when set to true deslot all jewels first, then executes slotting (calculations)
    UnSlotPropertiesFirst: false,

    //when set to true it won't use jewels marked for raiding
    SkipRaidingJewels: true,
    RaidingJewelColors: ["SERPENTINE", "SUNSTONE", "SLATE", "PREHNITE", "CATSEYE", "CHRYSOCOLLA", "ORANGE", "PERIDOT"],

    //handling the case of running out of available priming and booster jewels without fully slotting properties with resources
    FillPropertiesWithResourcesForMaximumEtherDetection: true,

    MaximumRepetitionForSameBoosterJewel: 3,
    MaximumRepetitionForSamePrimingJewel: 3,

    //filling remaining properties with whatever jewel is available
    FillRemainingPropertiesForMaximumEtherDetection: true,

    //when set to true -> only uses jewels found in your inventory (ONLY SET TO TRUE IF DoSlot is FALSE or you have all your properties unslotted either already or using DeSlotPropertiesFirst)
    UseInventoryJewelsOnly: true,

    //when set to true it allows to use not only multicolor jewels for resource boost but priming ones too
    AllowPrimingJewelForBoost: true,

    DoSlot: false,
});

